import React from 'react';
import Card from '../Card/Card.js';
import './Cards.css'

import { useSelector } from 'react-redux';
const Cards = ()=>{
    const datos = useSelector((state) => state.allVideoGamer);
    const busqueda =  datos.allVideoGamer
    


    console.log("Esta es la busqueda de la CARDS" +  busqueda.allVideoGamer)
    return (
        <div className='contenedor'>

           {
            
            busqueda.map((element, index)=> (
                
                element.map(revisar =>(
                       <Card key={index} data={revisar} />
                  
                ))
                
                                
             ))
                
            }

        </div>
    )
}

export default Cards;
